import { useNavigate } from "react-router-dom";

const DeliveryJob = ({ job, updateBtn, btnMessage }) => {
  const navigate = useNavigate();

  const handleUpdateButton = () => {
    updateBtn(job.id);
    navigate("/my-deliveries");
  };

  return (
    <section className="job">
      <div className="job-details">
        <p>{job.postcode}</p>
        <p>{job.address}</p>
        <p>{job.isAccepted}</p>
        <p>{job.isDelivered}</p>
        <p>{job.customerName}</p>
        <p>{job.volume}</p>
      </div>
      <div className="map">
      <iframe
        title="map"
        src={`https://maps.google.com/maps?q=${encodeURIComponent(job.address)}&z=15&output=embed`}
      ></iframe>
      <iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d2555133.026856938!2d-0.264864!3d51.2881767!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4876195d79244491%3A0xf80c100ac0c0861b!2sLouise%20Wade%20Jewellery!5e0!3m2!1sen!2suk!4v1713258759412!5m2!1sen!2suk" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
      </div>
      <div>
        <button onClick={handleUpdateButton}>{btnMessage}</button>
      </div>
    </section>
  );
};

export default DeliveryJob;
